#define CINT_SCALE 50

#include "cint.c"

#include <stdio.h>
#include <assert.h>
#include <sys/time.h>

double microtime() {
    struct timeval time;
    gettimeofday(&time, 0);
    return (double) time.tv_sec + (double) time.tv_usec / 1e6;
}

static int slow_miller_rabin(const cint *n, int k) {
    cint a, b, c, d, e, f, one;
    cint_init(&one, 1);
    if ((cint_compare(n, &one) == 0) == (n->data[CINT_SCALE - 1] & 1))
        return n->index == CINT_SCALE - 1 && n->data[n->index] == 2;
    cint_init(&a, 0);
    int h, i;
    cint_sub(n, &one, &c);
    for (b = c, h = 0; !(b.data[CINT_SCALE - 1] & 1); cint_down2i(&b), ++h);
    for (; k--;) {
        cint_rand(&a, CINT_SCALE - n->index);
        e = a;
        cint_modi(&e, &c);
        cint_addi(&e, &one);
        d = e;
        f = *n;
        do for (;;) {
                cint_modi(&d, &f);
                if (d.index == CINT_SCALE)
                    break;
                cint_modi(&f, &d);
                if (f.index == CINT_SCALE)
                    break;
            }
        while (cint_compare(&d, &one) > 0 && cint_compare(&f, &one) > 0);
        for (d = f = one; cint_compare(&f, &b) < 1; cint_up2i(&f));
        for (;;) {
            cint_down2i(&f);
            if (f.index == CINT_SCALE)
                break;
            cint_muli(&d, &d);
            cint_modi(&d, n);
            i = 0;
            for (size_t j = f.index - 1; ++j < CINT_SCALE && !(i = (f.data[j] & b.data[j]) != 0););
            if (i) {
                cint_muli(&d, &e);
                cint_modi(&d, n);
            }
        }
        if (cint_compare(&d, &one) == 0)
            continue;
        for (i = h; i-- && cint_compare(&d, &c) != 0;) {
            cint_muli(&d, &d);
            cint_modi(&d, n);
        }
        if (cint_compare(&d, &c) != 0)
            return 0;
    }
    return 1;
}

void verify_by_miller_rabin(const char *factor_1, const char *factor_2, const char *number) {
    cint a, b, c;
    cint_init_by_string(&a, factor_1, 10); // a prime.
    cint_init_by_string(&b, factor_2, 10); // a prime.
    assert(slow_miller_rabin(&a, 200) && slow_miller_rabin(&b, 200)); // assert both factors are prime after 200 iterations.
    cint_muli(&a, &b); // multiply them.
    cint_init_by_string(&c, number, 10);
    assert(memcmp(&a, &c, sizeof(cint)) == 0); // verify the result of multiplication.
    assert(!slow_miller_rabin(&a, 200)); // assert the result of multiplication isn't prime.
}

